import React, { useRef, useState } from "react";
import './Login.css';
import FormInputLogin from "./components/formInputLogin";
import LoginInputs from "./LoginInputs";
i
function Login(){
    
    const [values , setValues] = useState({
        email: "",
        password: "",
    });
    const [success , setSuccess] = useState(false)

    const handleSubmit = (e)=>{
        e.preventDefault(); 
        setSuccess(true)
    } 
    const handleChange = (e)=>{
        setValues({...values,[e.target.name]:e.target.value})

       
    }

    return (
    <>
   { success ? 
    (<div> <h1> Successfully Loged in </h1></div>)
    :
   ( <div className="loginWrapper">
        <form onSubmit={handleSubmit}>
        

        
        <img className='logo' src='./images/logo.png'/>
        {LoginInputs.map((input) => (<FormInputLogin key = {input.id} {...input} value = {values[input.name]} onChange = {handleChange}/>))}
        <a href = ""> forgot your password? </a>
        <button > Login</button>
        
        <p> Don't have an account? <a href=""> SignUp Here</a></p>
        </form> 
    </div>)}
</>)
}

export default Login;
